import React from "react";
//import PropTypes from "prop-types";

const Edit = props => {
  return (
    <div>
      <h2>Edit student name</h2>
      <form onSubmit={props.onEditStudentName}>
        <input
          type="text"
          name="editStudent"
          value={props.name}
          onChange={props.onChangeName}
        />
        <input type="submit" value="submit" />
      </form>
    </div>
  );
};

export default Edit;
